import React from 'react';
import Header from './components/Header.js';
import Footer from './components/Footer.js';
import Intro from './sections/Intro.js';
import About from './sections/About.js';
import Services from './sections/Services.js';
import Portfolio from './sections/Portfolio.js';
import Director from './sections/Director.js';
import MoreServices from './sections/MoreServ.js';
import Testimonials from './sections/Clients.js';
import Contacts from './sections/Contacts.js';
import BonusPage from './pages/BonusPage.js';
import ExtraPage from './pages/ExtraPage.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Intro />
      <About />
      <Services />
      <Portfolio />
      <Director />
      <MoreServices />
      <Testimonials />
      <Contacts />
      <BonusPage />
      <ExtraPage />
      <Footer />
    </div>
  );
}

export default App;
